import { gql } from "@apollo/client";

export const GET_ALL_CATEGORIES = gql`
  query {
    getAllCategories {
      id
      name
    }
  }
`;

export const GET_ALL_POSTS_SLIDE = gql`
  query FeedSearchQuery($filter: String!) {
    feed(filter: $filter) {
      name
      thumb
      slug

    }
  }
`;
